import {loginThunk} from "../services/users-thunks";
import React, {useEffect} from "react";
import {useDispatch, useSelector} from "react-redux";


const Profile = () => {
    const {currentUser} = useSelector(state => state.userData)
    const dispatch = useDispatch();

    if(currentUser) {
        return (
            <div className="list-group">
                <div className="list-group-item">
                    <img width={110} height={110} className="m-3 rounded-circle z-index-2" src="/images/profPic.jpg"/>
                </div>
                <div className="list-group-item">
                    <div className="mt-2"><b>{currentUser.username}</b></div>
                    <div>I love books, reading, and all kinds of things!</div>
                </div>

            </div>


        )
    }
    else{
        return(<button className="rounded-pill bg-primary text-white border-0" onClick={() => dispatch(loginThunk({username: "Daniel", password: "webdev123"}))}>Login</button>)
    }
};
//{currentUser ? currentUser.username : <button onClick={() => dispatch(loginThunk({username:"Daniel", password:"webdev123"}))}>Hi</button>}

export default Profile;
